backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/terraform.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_hostnames = true
  enable_dns_support   = true

  tags = {
    Name = "main-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = element(var.public_subnets, count.index)
  map_public_ip_on_launch = true
  availability_zone       = element(var.azs, count.index)

  tags = {
    Name = "public-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "main-gateway"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    Name = "public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count = length(var.public_subnets)

  subnet_id      = element(aws_subnet.public.*.id, count.index)
  route_table_id = aws_route_table.public.id
}

./modules/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "The CIDR block for the VPC."
  type        = string
}

variable "public_subnets" {
  description = "A list of public subnet CIDR blocks."
  type        = list(string)
}

variable "azs" {
  description = "A list of availability zones in the region."
  type        = list(string)
}

./modules/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC."
  value       = aws_vpc.main.id
}

output "public_subnet_ids" {
  description = "The IDs of the public subnets."
  value       = aws_subnet.public.*.id
}

output "internet_gateway_id" {
  description = "The ID of the Internet Gateway."
  value       = aws_internet_gateway.gw.id
}

./modules/ec2/main.tf.code:
resource "aws_launch_configuration" "app" {
  name_prefix          = "lc-${var.application_name}-"
  image_id             = var.ami_id
  instance_type        = var.instance_type
  user_data            = data.template_file.user_data.rendered
  security_groups      = [aws_security_group.app.id]
  lifecycle {
    create_before_destroy = true
  }
}

data "template_file" "user_data" {
  template = file("${path.module}/user_data.sh")

  vars = {
    server_text = var.server_text
  }
}

resource "aws_security_group" "app" {
  name_prefix = "sg-${var.application_name}-"
  vpc_id      = var.vpc_id

  ingress {
    description = "Allow traffic from ALB"
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    security_groups = [aws_security_group.alb.id]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_autoscaling_group" "app" {
  name_prefix           = "asg-${var.application_name}-"
  launch_configuration  = aws_launch_configuration.app.name
  min_size              = var.asg_min_size
  max_size              = var.asg_max_size
  desired_capacity      = var.asg_desired_capacity
  vpc_zone_identifier   = var.subnet_ids
  health_check_type     = "EC2"
  force_delete          = true
  wait_for_capacity_timeout = "0"

  tag {
    key                 = "Name"
    value               = "${var.application_name}-instance"
    propagate_at_launch = true
  }

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_security_group" "alb" {
  name_prefix = "alb-sg-${var.application_name}-"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_alb" "app" {
  name_prefix          = "alb-${var.application_name}-"
  internal             = false
  load_balancer_type   = "application"
  security_groups      = [aws_security_group.alb.id]
  subnets              = var.subnet_ids
  enable_deletion_protection = false

  tags = {
    Name = "app-load-balancer"
  }
}

resource "aws_alb_target_group" "app" {
  name_prefix      = "tg-${var.application_name}-"
  port             = 80
  protocol         = "HTTP"
  vpc_id           = var.vpc_id
  target_type      = "instance"

  health_check {
    path                = "/"
    protocol            = "HTTP"
    matcher             = "200"
  }

  tags = {
    Name = "app-target-group"
  }
}

resource "aws_alb_listener" "http" {
  load_balancer_arn = aws_alb.app.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.app.arn
  }
}

resource "aws_autoscaling_attachment" "asg_attachment" {
  autoscaling_group_name   = aws_autoscaling_group.app.id
  alb_target_group_arn     = aws_alb_target_group.app.arn
}

